import React from "react";
import classes from './cardBody.module.css'
import {CardBody, Col, Label, Row} from "reactstrap";
import FormatListNumberedIcon from '@material-ui/icons/FormatListNumbered';
import Translate from "../../../../Translate";
import InputUi from "../../../../components/inputUI/inputUI";

const BodyComponent = props => {

    const formDataRender = data => {
        let obj = []
        for (let item in data) {
            obj.push(
                <InputUi
                    margin={'0 0 20px'}
                    label={item}
                    type={'number'}
                    name={item}
                    value={data[item]}
                />
            )
        }
        return obj;
    }

    return (
        <CardBody>
            <h4 className='pb-2'>
                <FormatListNumberedIcon fontSize={'large'}/>
                <Translate name={'It is necessary to indicate the numbers of the sections in the corresponding field'}/>
            </h4>
            <Row>
                <Col md={6} className={classes.colWindow}>
                    <div>
                        {
                            formDataRender(props.formData.departOne)
                        }
                    </div>
                </Col>
                <Col md={6} className={classes.colWindow}>
                    <div>
                        <InputUi
                            margin={'0 0 20px'}
                            label={'classifiers'}
                            type={'number'}
                            name={'classifiers'}
                        />
                        <InputUi
                            margin={'0 0 20px'}
                            label={'suppliers'}
                            type={'number'}
                            name={'suppliers'}
                        />
                        <InputUi
                            margin={'0 0 20px'}
                            label={'barcode'}
                            type={'number'}
                            name={'barcode'}
                        />
                        <InputUi
                            margin={'0 0 20px'}
                            label={'description'}
                            type={'number'}
                            name={'description'}
                        />
                    </div>
                </Col>
            </Row>
        </CardBody>
    )
}

export default BodyComponent
